import React, { Component } from 'react';
import ContentContainer from '../../hoc/ContentContainer/ContentContainer';
import SectionTitle from '../SectionTitle/SectionTitle';
import SliderTemplates from'../Widgets/Slider_templates';
import data from '../../db';
import './CitySection.scss';


class CitySection extends Component {


render(){
  const {featuredCities} = data;
  console.log(featuredCities, "these are the cities");
  return(
    <section className = "city-section">
      <ContentContainer>
        <SectionTitle white> Choose From Any Major City In Texas </SectionTitle>
      </ContentContainer>
      <div className ="slider-container">
       <SliderTemplates type = "city" data ={featuredCities}/>
      </div>
      <div className = "city-section__background">
      </div>
    </section>
  )
}

}

export default CitySection;
